INSERT INTO `recipes` (`recipesid`, `name`, `description`, `rating`, `cuisine`, `cookingtime`, `img`) VALUES
(1, 'Spaghetti Bolognese', 'Once you’ve got this grown-up spag bol going the hob will do the rest. Any leftovers will taste even better the next day.', 4, 'Italian', '150', );
INSERT INTO `recipes` (`recipesid`, `name`, `description`, `rating`, `cuisine`, `cookingtime`, `img`) VALUES
(2, 'Vegan pancakes', 'Try this vegan fluffy American pancake recipe for a perfect start to the day. Serve these pancakes with fresh berries, maple syrup or chocolate sauce for a really luxurious start to the day.', 4, 'American', '60', );
INSERT INTO `recipes` (`recipesid`, `name`, `description`, `rating`, `cuisine`, `cookingtime`, `img`) VALUES
(3, 'Healthy pizza', 'No yeast required for this easy, healthy pizza, topped with colourful vegetables that\'s ready in 30 minutes.This is a great recipe if you want to feed the kids in a hurry!', 3, 'Italian', '30', );
INSERT INTO `recipes` (`recipesid`, `name`, `description`, `rating`, `cuisine`, `cookingtime`, `img`) VALUES
(4, 'Easy lamb biryani', 'This lamb biryani is real centrepiece dish, but it\'s actually easy as anything to make. Serve garnished with pomegranate seeds to make it look really special.', 3, 'Indian', '120', );
INSERT INTO `recipes` (`recipesid`, `name`, `description`, `rating`, `cuisine`, `cookingtime`, `img`) VALUES
(5, 'Couscous salad', 'A nutritious and satisfying vegan couscous salad packed with colour, flavour and texture, from dried cranberries, pistachios and pine nuts.', 5, 'North African', '40', );

